"use strict";(self.webpackChunkwaste_of_space_wiki=self.webpackChunkwaste_of_space_wiki||[]).push([[9170],{6072:e=>{e.exports=JSON.parse('{"tag":{"label":"Logic","permalink":"/Pilot.lua-Luau-LSP/tags/logic","allTagsPath":"/Pilot.lua-Luau-LSP/tags","count":44,"items":[{"id":"objects/AdBoard","title":"AdBoard","description":"Allows the creation of Ad elements, automatically. Very useful for making money.","permalink":"/Pilot.lua-Luau-LSP/objects/AdBoard"},{"id":"objects/Antenna","title":"Antenna","description":"A wireless transmitter that can transmit electricity from wires and trigger signals from trigger wires and buttons.","permalink":"/Pilot.lua-Luau-LSP/objects/Antenna"},{"id":"objects/ARController","title":"ARController","description":"Like a TouchScreen, but for your actual screen.","permalink":"/Pilot.lua-Luau-LSP/objects/ARController"},{"id":"objects/Button","title":"Button","description":"Sends trigger signals when clicked by a player.","permalink":"/Pilot.lua-Luau-LSP/objects/Button"},{"id":"objects/Camera","title":"Camera","description":"It\'s a camera.","permalink":"/Pilot.lua-Luau-LSP/objects/Camera"},{"id":"objects/Controller","title":"Controller","description":"Alters the speed of attached controllable objects which include:","permalink":"/Pilot.lua-Luau-LSP/objects/Controller"},{"id":"objects/DelayWire","title":"DelayWire","description":"Similar to a regular trigger wire, but depending on the configuration will wait x seconds before the trigger signal passes through.","permalink":"/Pilot.lua-Luau-LSP/objects/DelayWire"},{"id":"objects/DeleteSwitch","title":"DeleteSwitch","description":"An object that deletes itself when triggered.","permalink":"/Pilot.lua-Luau-LSP/objects/DeleteSwitch"},{"id":"objects/Disk","title":"Disk","description":"A programmable object capable of storing complex data.","permalink":"/Pilot.lua-Luau-LSP/objects/Disk"},{"id":"objects/Electromagnet","title":"Electromagnet","description":"A powerful magnet.","permalink":"/Pilot.lua-Luau-LSP/objects/Electromagnet"},{"id":"objects/EthernetCable","title":"EthernetCable","description":"Allows for the transfer of data between ports. Mostly utilized in programming.","permalink":"/Pilot.lua-Luau-LSP/objects/EthernetCable"},{"id":"objects/Hatch","title":"Hatch","description":"Acts as a chute when active/gray, but when black or inactive it acts as a normal object.","permalink":"/Pilot.lua-Luau-LSP/objects/Hatch"},{"id":"objects/HeatValve","title":"HeatValve","description":"Acts as a HeatPipe when active/red, but when black or inactive it acts as a normal object.","permalink":"/Pilot.lua-Luau-LSP/objects/HeatValve"},{"id":"objects/Igniter","title":"Igniter","description":"Sets alight unlocked parts within the immediate vicinity when triggered. Range depends on the size.","permalink":"/Pilot.lua-Luau-LSP/objects/Igniter"},{"id":"objects/Instrument","title":"Instrument","description":"A part that measures information about the world.","permalink":"/Pilot.lua-Luau-LSP/objects/Instrument"},{"id":"objects/Keyboard","title":"Keyboard","description":"Similar to a button, except is programmable to take more than one key input.","permalink":"/Pilot.lua-Luau-LSP/objects/Keyboard"},{"id":"objects/LifeSensor","title":"LifeSensor","description":"Senses and detects organic life up to a distance of 2000 studs. It only has a purpose within programming.","permalink":"/Pilot.lua-Luau-LSP/objects/LifeSensor"},{"id":"objects/Microcontroller","title":"Microcontroller","description":"Runs limited Roblox luau code in an environment called \\"pilot.lua\\".","permalink":"/Pilot.lua-Luau-LSP/objects/Microcontroller"},{"id":"objects/Microphone","title":"Microphone","description":"Used in programming. Takes user\'s input from chat.","permalink":"/Pilot.lua-Luau-LSP/objects/Microphone"},{"id":"objects/Modem","title":"Modem","description":"A part that allows you to send messages cross-region and make HTTP requests to the web.","permalink":"/Pilot.lua-Luau-LSP/objects/Modem"},{"id":"objects/ObjectDetector","title":"ObjectDetector","description":"Casts a ray on the face with the hole on it, returning data of the object the ray hits.","permalink":"/Pilot.lua-Luau-LSP/objects/ObjectDetector"},{"id":"objects/Polysilicon","title":"Polysilicon","description":"An electronic material which transforms a trigger signal into special on/off/toggle signals.","permalink":"/Pilot.lua-Luau-LSP/objects/Polysilicon"},{"id":"objects/Port","title":"Port","description":"Only used in programming. Allows a Microcontroller to interface with PilotObjects.","permalink":"/Pilot.lua-Luau-LSP/objects/Port"},{"id":"objects/ProximityButton","title":"ProximityButton","description":"Sends trigger signals when interacted via its ProximityPrompt.","permalink":"/Pilot.lua-Luau-LSP/objects/ProximityButton"},{"id":"objects/RemoteControl","title":"RemoteControl","description":"Sends trigger signals forward wirelessly when triggered. Supports all variants of trigger signals including from Polysilicon.","permalink":"/Pilot.lua-Luau-LSP/objects/RemoteControl"},{"id":"objects/Router","title":"Router","description":"A wireless transmitter that can transmit an ethernet connection.","permalink":"/Pilot.lua-Luau-LSP/objects/Router"},{"id":"objects/Scanner","title":"Scanner","description":"An end-game part which can remotely retrieve Microcontroller references to parts, providing information and control. Can also triangulate the positions of enemy parts given enough well placed scanners.","permalink":"/Pilot.lua-Luau-LSP/objects/Scanner"},{"id":"objects/Screen","title":"Screen","description":"Allows for the programmatic creation of GUI elements.","permalink":"/Pilot.lua-Luau-LSP/objects/Screen"},{"id":"objects/Speaker","title":"Speaker","description":"Plays audio of length up to 5 seconds, unless it is powered in which case it can play a full audio.","permalink":"/Pilot.lua-Luau-LSP/objects/Speaker"},{"id":"objects/StorageSensor","title":"StorageSensor","description":"When the number of contents within connected storage objects is within a defined range, it will send trigger signals similar to a button.","permalink":"/Pilot.lua-Luau-LSP/objects/StorageSensor"},{"id":"objects/Switch","title":"Switch","description":"Acts as a wire when active/green, but when black or inactive it acts as a normal object. Must use a polysilicon to switch for trigger events.","permalink":"/Pilot.lua-Luau-LSP/objects/Switch"},{"id":"objects/TemperatureGate","title":"TemperatureGate","description":"The gate will allow power to pass through it while the temperature is in a certain range.","permalink":"/Pilot.lua-Luau-LSP/objects/TemperatureGate"},{"id":"objects/TemperatureSensor","title":"TemperatureSensor","description":"When the surrounding temperature is within the defined range, it will emit a trigger signal every two seconds.","permalink":"/Pilot.lua-Luau-LSP/objects/TemperatureSensor"},{"id":"objects/TimeSensor","title":"TimeSensor","description":"When the current time matches the time configured in the TimeSensor, it will send a trigger signal.","permalink":"/Pilot.lua-Luau-LSP/objects/TimeSensor"},{"id":"objects/TouchScreen","title":"TouchScreen","description":"A Screen, but can handle player mouse input.","permalink":"/Pilot.lua-Luau-LSP/objects/TouchScreen"},{"id":"objects/TouchSensor","title":"TouchSensor","description":"Sends trigger signals upon contact.. with anything.","permalink":"/Pilot.lua-Luau-LSP/objects/TouchSensor"},{"id":"objects/Transformer","title":"Transformer","description":"Sends a constant trigger signal when powered. By default, it will send a trigger signal every tick, but can be configured up to every 360 seconds. If the transformer\'s loop time matches the game\'s internal tick rate (the default,  1/s), it will synchronize with the game loop.","permalink":"/Pilot.lua-Luau-LSP/objects/Transformer"},{"id":"objects/Transporter","title":"Transporter","description":"Acts as an antenna but for bins and objects containing materials such as liquids and solids.","permalink":"/Pilot.lua-Luau-LSP/objects/Transporter"},{"id":"objects/TriggerRelay","title":"TriggerRelay","description":"Acts as a TriggerWrite when active/green, but when black or inactive it acts as a normal object, it will not toggle when exposed to Polysilicon signals, rather, it will pass them through if it is active, as if it were a normal signal.","permalink":"/Pilot.lua-Luau-LSP/objects/TriggerRelay"},{"id":"objects/TriggerSwitch","title":"TriggerSwitch","description":"Acts as a TriggerWrite when active/green, but when black or inactive it acts as a normal object. It will toggle when exposed to Polysilicon signals.","permalink":"/Pilot.lua-Luau-LSP/objects/TriggerSwitch"},{"id":"objects/TriggerWire","title":"TriggerWire","description":"Allows trigger objects to interact with each other when connected by triggerwires.","permalink":"/Pilot.lua-Luau-LSP/objects/TriggerWire"},{"id":"objects/Valve","title":"Valve","description":"Acts as a pipe when active/gray, but when black or inactive it acts as a normal object.","permalink":"/Pilot.lua-Luau-LSP/objects/Valve"},{"id":"objects/WirelessButton","title":"WirelessButton","description":"Similar to a button, but can be clicked from infinite distances and cannot be used for keybinds.","permalink":"/Pilot.lua-Luau-LSP/objects/WirelessButton"},{"id":"objects/ZapWire","title":"ZapWire","description":"Electrocutes players when touched. Can be used to set flammable objects on fire.","permalink":"/Pilot.lua-Luau-LSP/objects/ZapWire"}],"unlisted":false}}')}}]);